143X)"]},{"cell_type":"markdown","id":"3172689f","metadata":{"papermill":{"duration":0.00566,"end_time":"2023-12-30T12:01:05.080928","exception":false,"start_time":"2023-12-30T12:01:05.075268","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"898e7734","metadata":{"papermill":{"duration":0.005505,"end_time":"2023-12-30T12:01:05.092852","exception":false,"start_time":"2023-12-30T12:01:05.087347","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"e12d7623","metadata":{"execution":{"iopub.execute_input":"2023-12-30T12:01:05.107061Z","iopub.status.busy":"2023-12-30T12:01:05.105721Z","iopub.status.idle":"2023-12-30T12:01:05.162837Z","shell.execute_reply":"2023-12-30T12:01:05.160851Z"},"papermill":{"duration":0.066534,"end_time":"2023-12-30T12:01:05.164986","exception":false,"start_time":"2023-12-30T12:01:05.098452","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>